    "def CU3(args):\n",
    "    mat = np.zeros((4, 4), dtype=complex)\n",
    "    mat[0, 0] = mat[1, 1] = 1.0\n",
    "    mat[2:4, 2:4] = U3(args)\n",
    "\n",
    "    return Qobj(mat, dims=[[2, 2], [2, 2]])\n",
